children.description:
如果indeterminate未启用时, 应提供并列的两个孩子作为切换元素, 其中第一个为on时的显示元素, 第二个为off时的显示元素;
否则应提供并列的三个孩子, 其中前两个作为切换元素, 最后一个作为中间态时的显示元素.
元素可以是任意有效的React元素.

onColumnFiltersChange.description:
各类功能项的单独状态处理.
这是推荐方式, 这样只会控制单独功能项的状态. 并且只需在state中设置你想管理的那些状态即可.
@example const [sorting, setSorting] = React.useState([])
// 方式1, 直接赋值给React的setState
onSortingChange: setSorting;
// 方式2, 需要对状态做额外处理
onSortingChange: (updater) => {
 // 必须这样得到表的新状态值
 const newSortingValue = updater instanceof Function ? updater(sorting) : updater
 //do something with the new sorting value
 //...
 setSorting(updater) //normal state update
}
